function findingPosition(equipos, nombreJugador) {
  const jugadorBuscado = nombreJugador.toLowerCase();
  const jugadorSplit = jugadorBuscado.split(" ")
  const jugadorSplitCero = jugadorSplit[0]
  const jugadorInicial = jugadorSplitCero[0]
  const jugadorPuntoDos = `${jugadorInicial}. ${jugadorSplit[1]}`
  const jugadorPuntoTres = `${jugadorInicial}. ${jugadorSplit[1]} ${jugadorSplit[2]}`
  let jugador
  if(jugadorSplit.length === 2){
    jugador = jugadorPuntoDos
  } else if (jugadorSplit.length === 3){
    jugador = jugadorPuntoTres
  }
  let pos

  for(let i = 0 ; i < equipos.length ; i++){
    let name = equipos[i].name
    if (name.toLowerCase() === jugadorBuscado || name.toLowerCase() === jugador) {
      pos = equipos[i]
    } 
    if(pos === undefined){
      pos = nombreJugador
    }
  }
  return pos
}
function findingdvp(position, team){
  let dvpValue 
  const stats = dvp[position]
  if(position !== undefined){
    stats.forEach(el =>{
      if (el.Name !== undefined){
        if (el.Name.includes(team)) { dvpValue = el }
      }
    })
  }
  return dvpValue
}
export default function enrichPlayers(playerswithgamesid){
    playerswithgamesid.forEach(element => {
        const position = findingPosition(rosters, element.name)
        element.position = position

        const dvpVal = findingdvp(position.pos, element.opponent)
        element.dvp = dvpVal
    });
    return playerswithgamesid
}

